import React from "react";

export default function favorit() {
  return (
    <div>
      <div className="container mx-auto">
        <div className="judul font-sans font-medium text-2xl text-green mb-5">
          <h1>Agen Bus Terfavorit Bulan Ini</h1>
        </div>
        <div className="grid lg:grid-rows-2  lg:grid-cols-12 relative">
          <div className="lg:col-span-4 lg:row-span-2"></div>
        </div>
      </div>
    </div>
  );
}
